import dates from './test1/dates';
import TestList from './components/TestList.vue';
export default {
  name: 'App',
  components: {
    TestList
  },
  component: ('task-list', {
    props: ['tasks'],
    template: `
    <div class="list">
    <div class="item" :class="{done: task.done}" v-for="task in tasks" :key="task.text">
      <input type="checkbox" v-model="task.done">
      {{ task.text }}
    </div>
  </div>
    `
  }),
  data() {
    return {
      dates,
      tasks: [{
        text: 'White',
        done: true
      }, {
        text: 'Black',
        done: false
      }, {
        text: 'Pink',
        done: false
      }, {
        text: 'Blue',
        done: false
      }, {
        text: 'Red',
        done: false
      }]
    };
  },
  methods: {
    completedTasks() {
      return this.tasks.filter(task => task.done);
    },
    uncompletedTasks() {
      return this.tasks.filter(task => !task.done);
    }
  }
};
